var strings={capitalizeAll:function(t){var r=[];return t.split(" ").forEach(function(t){r.push(t.toString().charAt(0).toUpperCase()+t.slice(t.length-(t.length-1)))}),r.join(" ")},capitalizeFirst:function(t){return t.toString().charAt(0).toUpperCase()+t.slice(t.length-(t.length-1))},numberCommas:function(t){return t.toString().replace(/\B(?=(\d{3})+(?!\d))/g,",")},numberLakhs:function(t){t=t.toString();var r=t.indexOf(".")>0?t.substring(t.indexOf("."),t.length):"";t=Math.floor(t).toString();var n=t.substring(t.length-3),e=t.substring(0,t.length-3);return n=""!=e?","+n:n,e.replace(/\B(?=(\d{2})+(?!\d))/g,",")+n+r},reverseLetters:function(t){return t.toString().split("").reverse().join("")},reverseWords:function(t){return t.toString().split(" ").reverse().join(" ")}};